    StringLocalization.HGOverview: 'Health Gauge Overview',
    StringLocalization.HGIntro:
        "Health Gauge is a platform for personal health monitoring and management. Users of the platform include the general public interested in health and wellness, care providers working with users, researchers that access the data in order to develop and deliver analytics, and business partners the provide goods and services to the Health Gauge community of users. The platform accepts connections from a variety of health devices as well as fitness wearables; however, users can use Health Gauge without a device to monitor and manage their health and work with their care team even if they don't have a health device.\nThe components of Health Gauge mobile application include the following:",
