    StringLocalization.signUpInfo:
        'User can use this page to register for an account. Once an account is created, the profile information for the account is stored locally but synchronized with the Health Gauge server. Note that the application can still be used without an account, but no data will be saved.',
    StringLocalization.resetPassword: 'Reset Password',
    StringLocalization.resetPasswordInfo: 'Users can request a password reset.',
    StringLocalization.home: 'Home',
    StringLocalization.homeInfo:
        'Home page is consisting of :\n1 -  Title bar \n2 - Main area \n3 - Navigation bar \n1 - The home page allows a person from the title bar to navigate to the profile page, Message centre, the connection and settings. \n2 - In the main area users can see Circle indicators, Progress bars , and guide bars bars. Circle indicators have different meanings depend on their type. \n3 - The navigation bar supports immediate access to Home, Graph, Measurement, Diary and Help page. ',
    StringLocalization.HGProfile: 'Profile',
    StringLocalization.profileInfo:
        "User profile data stores the user's picture, name, id, birthdate, height, weight, max weight, gender, skin color and researcher profile. This data is synchronized with the web server. Valid data is essential for the AI system because this data is used to calculate estimates.",
    StringLocalization.HGConnection: 'Connections',
    StringLocalization.connectionInfo:
        'The Connections page lists available BLE devices. Each device has an id associated with it and it is that id that displays in the connection list. User must select the device and "Connect". The device will stay connected continuously and will automatically reconnect if the connection is lost.',
    StringLocalization.HGSettings: 'Settings',
    StringLocalization.settingsInfo:
        'The settings page allows the user to access device management functions, set activity and sleep targets, view the version number, find the bracelet, and see historical measurements for activities, sleep, cardio and tags. The tag label editor is also accessible as well as the terms and conditions of use and the training flag (See below).',
    StringLocalization.cardioMeasurement: 'Cardio Measurement',
    StringLocalization.cardioMeasurementInfo:
        'The settings page allows the user to access device management functions, set activity and sleep targets, view the version number, find the bracelet, and see historical measurements for activities, sleep, cardio and tags. The tag label editor is also accessible as well as the terms and conditions of use and the training flag (See below).',
    StringLocalization.activityDay: 'Activity Day',
    StringLocalization.activityDayInfo:
        'Health Gauge tracks user steps. Based on profile information user calories and distance traveled is estimated. A week and month summary view of the data can be displayed. The data is stored locally and sent to the server. If not online, data is flagged for synchronization.',
    StringLocalization.activityWeeklyMonthly: 'Activity Weekly & Monthly Summary',
    StringLocalization.activityWeeklyMonthlyInfo:
        'The activity data is summarized on each graph with a weekly summary view or a monthly summary view.',
    StringLocalization.HGSleep: 'Sleep',
    StringLocalization.sleepInfo:
        'During the night, sleep is tracked based on motion. Sleep is measured in 15-minute increments and detects variations of awake, light-sleep, and deep-sleep. A color chart is displayed by time increment. A week and month summary view of the data can be displayed. The data is stored locally and sent to the server. If not online, data is flagged for synchronization.',
    StringLocalization.HGTag: 'Tag',
    StringLocalization.tagInfo:
        'A user can tag any reading they want at any time. 9 default tags are provided but the user can create more. Tags record a point of interest for a user that is not automatically captured by the device. For example, temperature, fatigue, blood glucose, eating, drugs, etc. The tag page allows a user to select the tag type, indicate a reading level and add notes if necessary.',
    StringLocalization.tagEditorList: 'Tag Editor List',
    StringLocalization.tagEditorListInfo:
        'This page appears in the settings area. It allows users to create or edit tags. (See Tag) The first screen is a list of available tags to edit. The user can click + to add another tag. Note that these tags are synchronized with the web site. User can delete tags or edit them.',
    StringLocalization.tagEditor: 'Tag Editor',
    StringLocalization.tagEditorInfo:
        'This appears as a popup and allows the user to edit the details of a tag. User can indicate tag label, the unit of measurement, the range of values allowed and the precision level. User can also select a default value.',
    StringLocalization.HGGraph: 'Graph',
    StringLocalization.graphInfo:
        'This page is a type of dashboard. Users can add widgets which are collections of measures over the selected period of time. A week and month summary view of the data can be displayed. Users can add or remove any widget. Each displayed widget can be edited to add or delete any measurement or tag value within the system.',
    StringLocalization.HGMeasurementHistory: 'Measurement History',
    StringLocalization.measurementHistoryInfo:
        'This option is available in settings. User can see the cardio measurements in day, week, or month groupings.',
    StringLocalization.HGTagHistory: 'Tag History',
    StringLocalization.tagHistoryInfo:
        'This option is available in settings. User can see the tag assignments in day, week, or month groupings.',
