    StringLocalization.disclaimerInfo:
        "Health gauge app and its device is an aid, designed to help you improve your life quality.  It does not substitute for medical advice or diagnosis and doing so might have serious health consequences.\n\nThe Health Gauge Phoenix+FIT and application is to be used to consolidate and track health metrics that will allow for a more comprehensive overview of current health management. Under no circumstances is the Health Gauge Phoenix+FIT to directly impact the diagnosis, treatment, or management of an individual's disease.\n\nThe Phoenix+FIT application has been designed to serve as a means of personal health monitoring and tracking and is intended to be used to maintain a healthy lifestyle, and understand one's health and is, therefore, a wellness device. In no case is the software and AI technology utilized by Health Gauge to replace the professional clinical judgment of a health care professional.\n\nIf you think that you have a medical problem, please consult your doctor.\n\nWHEN SUPPORTED FOR INVESTIGATIONAL USE:\n\nWhere the Health Gauge application is supported for clinical research, or investigational use by Health Canada and/or the US Food and Drug Administration, it should only be used as indicated and by qualified Investigators only.\n\nWhen a user requests the deletion of their account, it is important to note that while their account information will be removed from active databases, certain data associated with their account may still be retained for training and research purposes. This retained data, anonymized or aggregated, contributes to service improvement and research advancements. Users can reach out to Health Gauge with any concerns regarding data handling after account deletion.",
