    StringLocalization.hrvInfo:
        'Heart Rate Variability, HRV, is the variation in the interval between heartbeats. HRV always goes up when someone is feeling better. The goal is usually to shoot for the highest HRV reading you can get over time, though you should expect to have a few dips when training hard.\n\nThis variation is controlled by a primitive part of the nervous system called the autonomic nervous system (ANS) which also controls our heart rate, blood pressure, breathing, and digestion.\n\nIf we have persistent instigators such as stress, poor sleep, unhealthy diet, dysfunctional relationships, isolation or solitude, and lack of exercise, your fight-or-flight response can shift into overdrive causing a lower HRV number. If one is in a more relaxed state, the variation between beats is high.\n\nHRV is an interesting and noninvasive way to identify these ANS imbalances. Over the past few decades, research has shown a relationship between low HRV and worsening depression or anxiety. A low HRV is even associated with an increased risk of death and cardiovascular disease.\n\n\nSource: Harvard Medical School',
    StringLocalization.forReference: 'For more reference please click on the link below:\n',
    StringLocalization.tempInfo:
        'Normal human body temperature (normothermia,euthermia) is the typical temperature range found in humans. The normal human body temperature range is typically stated as 36.5–37.5°C (97.7–99.5°F).\nHuman body temperature varies. It depends on sex, age, time of day, exertion level, health status (such as illness and menstruation), what part of the body the measurement is taken at, state of consciousness (waking, sleeping, sedated), and emotions. Body temperature is kept in normal range by thermoregulation, in which adjustment of temperature is triggered by the central nervous system.\n\nHot\n•    44°C (111.2°F) or more – Almost certainly death will occur; however, people have been known to survive up to 46.5°C (115.7°F).\n•    43°C (109.4°F) – Normally death, or there may be serious brain damage, continuous convulsions and shock. Cardio-respiratory collapse will likely occur.\n•    42°C (107.6°F) – Subject may turn pale or remain flushed and red. They may become comatose, be in severe delirium, vomiting, and convulsions can occur. Blood pressure may be high or low and heart rate will be very fast.\n•    41°C (105.8°F) – (Medical emergency) – Fainting, vomiting, severe headache, dizziness, confusion, hallucinations, delirium and drowsiness can occur. There may also be palpitations and breathlessness.\n•    40°C (104°F) – Fainting, dehydration, weakness, vomiting, headache, breathlessness and dizziness may occur as well as profuse sweating. Starts to be life-threatening.\n•    39°C (102.2°F) – Severe sweating, flushed and red. Fast heart rate and breathlessness. There may be exhaustion accompanying this. Children and people with epilepsy may be very likely to get convulsions at this point.\n•    38°C (100.4°F) – (Classed as hyperthermia if not caused by a fever) – Feeling hot, sweating, feeling thirsty, feeling very uncomfortable, slightly hungry. If this is caused by fever, there may also be chills.\n\nNormal\n•    36.5–37.5°C (97.7–99.5°F) is a typically reported range for normal body temperature.\n\nCold\n•    36°C (96.8°F) – Feeling cold, mild to moderate shivering. Body temperature may drop this low during sleep. May be a normal body temperature.\n•    35°C (95°F) – (Hypothermia is less than 35°C (95°F)) – Intense shivering, numbness and bluish/grayness of the skin. There is the possibility of heart irritability.\n•    34°C (93.2°F) – Severe shivering, loss of movement of fingers, blueness and confusion. Some behavioural changes may take place.\n•    33°C (91.4°F) – Moderate to severe confusion, sleepiness, depressed reflexes, progressive loss of shivering, slow heart beat, shallow breathing. Shivering may stop. Subject may be unresponsive to certain stimuli.\n•    32°C (89.6°F) – (Medical emergency) – Hallucinations, delirium, complete confusion, extreme sleepiness that is progressively becoming comatose. Shivering is absent (subject may even think they are hot). Reflex may be absent or very slight.\n•    31°C (87.8°F) – Comatose, very rarely conscious. No or slight reflexes. Very shallow breathing and slow heart rate. Possibility of serious heart rhythm problems.\n•    28°C (82.4°F) – Severe heart rhythm disturbances are likely and breathing may stop at any time. Patient may appear to be dead.\n•    24–26°C (75.2–78.8°F) or less – Death usually occurs due to irregular heart beat or respiratory arrest; however, some patients have been known to survive with body temperatures as low as 14.2°C (57.6°F)',
    StringLocalization.spO2Info:
        'What is blood oxygen saturation(Spo2)?\nBlood oxygen saturation (SpO2) is the percentage of hemoglobin in the blood that contains oxygen- in other words, the amount of oxygen in the blood. It is a useful natural indicator of the condition of a person\'s respiratory system. If your SpO2 is below 90%, you may be at risk of developing hypoxemia. Generally speaking,the lower your SpO2 is below 90%, you may be at risk of developing hypoxemia. Generally speaking,the lower your SpO2,the higher the risk. Use the data below for reference:\n\n● ≥ 95%\n● < 90%\n\nNote: This device\'s measurement range is 50%-100%\n\nImportant things to note when measuring SpO2\n1. Enable the Spo2 feature on the wearable device Follow the instructions on your device to ensure the most accurate results.\n2. Certain external factors may interfere with the measurement, causing it to be inaccurate or even fail These include low blood flow, arm hair, tattoos, flabby skin, moving your arm during the measurement, not wearing your device correctly, room temperature, and so on.\n3.Measurement results are for reference only and are not intended as a basis for medical diagnosis.',
    StringLocalization.bpInfo:
        'Data presented is for information, and not considered as medical data.\n\nThis band is not intended for medical use. Please consult your physician for health related concerns.\n\nThe five blood pressure ranges as recognized by the American Heart Association are:\n\nNormal - Blood pressure numbers of less than 120/80 mm Hg are considered within the normal range. If your results fall into this category, stick with heart-healthy habits like following a balanced diet and getting regular exercise.\n\nElevated - Elevated blood pressure is when readings consistently range from 120-129 systolic and less than 80 mm Hg diastolic. People with elevated blood pressure are likely to develop high blood pressure unless steps are taken to control the condition.\n\nHypertension Stage 1 - Hypertension Stage 1 is when blood pressure consistently ranges from 130-139 systolic or 80-89 mm Hg diastolic. At this stage of high blood pressure, doctors are likely to prescribe lifestyle changes and may consider adding blood pressure medication based on your risk of atherosclerotic cardiovascular disease (ASCVD), such as heart attack or stroke..\n\nHypertension Stage 2 - Hypertension Stage 2 is when blood pressure consistently ranges at 140/90 mm Hg or higher. At this stage of high blood pressure, doctors are likely to prescribe a combination of blood pressure medications and lifestyle changes.\n\nHypertensive crisis - This stage of high blood pressure requires medical attention. If your blood pressure is higher than 180/120 mm Hg and you are experiencing signs of possible organ damage such as chest pain, shortness of breath, back pain, numbness/weakness, change in vision or difficulty speaking, do not wait to see if your pressure comes down on its own. Call for emergency medical help immediately.\n\nNote: A diagnosis of high blood pressure must be confirmed with a medical professional. A doctor should also evaluate any unusually low blood pressure readings.\n\nSource: American Heart Association',

